script: |
  super -f text -I q10642.spq | sort > q10642.out

inputs:
  - name: q10642.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col1 + - col1 IN ( + col1 + col0 * col2 );
  - name: tab2

outputs:
  - name: q10642.out
    data: |
      7
      78
      79
